import fourth from "../images/Banner/fourth.jpg";
import second from "../images/Banner/second.jpg";
import third from "../images/Banner/third.jpg";
import fifth from "../images/Banner/fifth.jpg";
import Carousel from "react-bootstrap/Carousel";
import tenth from "../images/Banner/tenth.jpeg";

function Banner() {
  return (
    <div className="container">
      <Carousel>
        <Carousel.Item interval={2000}>
          <img className="d-block w-100" height={400} width={10} src={fifth} alt="First slide" />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item interval={2000}>
          <img className="d-block w-100" height={400} width={10} src={second} alt="Second slide" />
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" height={400} width={10} src={third} alt="Third slide" />
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </div>
  );
}

export default Banner;
